import { useEffect, useState } from "react"; 
import axios from "axios";
import { useNavigate } from "react-router-dom";
import { FaUser, FaEnvelope, FaCalendarAlt, FaRoute, FaSignOutAlt } from "react-icons/fa";

interface Client {
  idClient: number;
  emailClient: string;
  numeClient: string;
  prenumeClient: string;
}

interface Rezervare {
  id: number;
  dataRezervare: string;
  ruta: {
    orasPlecare: string;
    orasSosire: string;
  };
}

const ProfilePage = () => {
  const [client, setClient] = useState<Client | null>(null);
  const [rezervari, setRezervari] = useState<Rezervare[]>([]);
  const navigate = useNavigate();

  useEffect(() => {
    const clientId = localStorage.getItem("clientId");
    if (!clientId) {
      return;
    }

    axios.get(`https://localhost:7239/api/Client/${clientId}`)
      .then(response => {
        setClient(response.data);
      })
      .catch(error => {
        console.error("Eroare la preluarea datelor client:", error);
      });

    axios.get(`https://localhost:7239/api/Rezervari/client/${clientId}`)
      .then(response => {
        setRezervari(response.data);
      })
      .catch(error => {
        console.error("Eroare la preluarea rezervărilor:", error);
      });
  }, []);

  const handleLogout = () => {
    localStorage.removeItem("clientId");
    navigate("/login");
  };

  const formatDate = (dateString: string) => {
    const date = new Date(dateString);
    if (isNaN(date.getTime())) {
      return "Data invalidă";
    }
    return date.toLocaleDateString() + " " + date.toLocaleTimeString();
  };

  return (
    <div className="max-w-3xl mx-auto p-8 bg-white rounded-3xl shadow-xl mt-10">
      <h2 className="text-3xl font-extrabold mb-8 text-gray-900">Profilul Meu</h2>
      {client ? (
        <>
          {/* Info Client */}
          <div className="space-y-4 text-gray-800 mb-8">
            <p className="flex items-center text-lg">
              <FaUser className="mr-3 text-blue-600" /> 
              <span className="font-semibold mr-2">Nume:</span> {client.numeClient}
            </p>
            <p className="flex items-center text-lg">
              <FaUser className="mr-3 text-green-600" /> 
              <span className="font-semibold mr-2">Prenume:</span> {client.prenumeClient}
            </p>
            <p className="flex items-center text-lg">
              <FaEnvelope className="mr-3 text-purple-600" /> 
              <span className="font-semibold mr-2">Email:</span> {client.emailClient}
            </p>
          </div>

          <hr className="mb-8 border-gray-300" />

          {/* Rezervari */}
          <h3 className="text-2xl font-semibold mb-6 text-gray-900 flex items-center">
            <FaCalendarAlt className="mr-3 text-red-500" /> Rezervările mele
          </h3>
          {rezervari.length > 0 ? (
            <div className="space-y-5">
              {rezervari.map((rezervare) => (
                <div
                  key={rezervare.id}
                  className="p-5 border border-gray-200 rounded-xl shadow-sm hover:shadow-md transition flex flex-col sm:flex-row sm:justify-between items-start sm:items-center"
                >
                  <div className="flex items-center mb-3 sm:mb-0">
                    <FaRoute className="text-blue-500 mr-3" size={22} />
                    <span className="font-medium text-lg text-blue-700">
                      {rezervare.ruta.orasPlecare} → {rezervare.ruta.orasSosire}
                    </span>
                  </div>
                  <div className="flex items-center text-gray-600">
                    <FaCalendarAlt className="mr-2" />
                    <span>{formatDate(rezervare.dataRezervare)}</span>
                  </div>
                </div>
              ))}
            </div>
          ) : (
            <p className="text-gray-600">Nu ai rezervări făcute.</p>
          )}

          {/* Logout */}
          <button
            onClick={handleLogout}
            className="mt-12 w-full py-3 bg-red-600 hover:bg-red-700 text-white rounded-2xl font-semibold flex justify-center items-center space-x-2 transition"
          >
            <FaSignOutAlt size={20} />
            <span>Logout</span>
          </button>
        </>
      ) : (
        <p className="text-center text-gray-600 mt-6">Nu ești autentificat.</p>
      )}
    </div>
  );
};

export default ProfilePage;
